import App, { Container } from 'next/app';
const { default: Navbar } = require('../Components/Navbar');

function MyApp({ Component, pageProps }) {
	return (
		<Container>
			<Navbar />
			<Component {...pageProps} />
		</Container>
	);
}

export default MyApp;
